INSERT INTO `wp_posts` VALUES (1,1,'2018-03-22 15:27:28','2018-03-22 15:27:28','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2018-03-22 15:27:28','2018-03-22 15:27:28','',0,'http://localhost/wordpress/?p=1',0,'post','',1),(2,1,'2018-03-22 15:27:28','2018-03-22 15:27:28','[wpgmza id=\"1\"]\r\n<h1>Esto es una prueba</h1>\r\n<h1></h1>','Inicio','','publish','closed','open','','inicio','','','2018-03-23 14:53:42','2018-03-23 18:53:42','',0,'http://localhost/wordpress/?page_id=2',0,'page','',0),(13,1,'2018-03-22 12:51:43','2018-03-22 16:51:43','<h2>Contáctanos</h2>\r\n<p>Supermercados Max, es una línea de almacenes de cadena ubicada en la ciudad de San Carlos de Bariloche - Argentina, tenemos 10 puntos de venta que los puedes visualizar en el siguiente mapa al final de esta página.</p>\r\n\r\n<h4>Comunícate con nosotros</h4>\r\n<p col-xs-12 col-md-12>Contacta a nuestros expertos sobre cualquier duda o comentario que tengas sobre nuestras tiendas.Puedes comunitarte vía email, teléfono o directamente visitando nuestras tiendas</p>\r\n<a tel=\"+123456789\"><i class=\"glyphicon glyphicon-envelope\"></i>+123456789</a></br>\r\n<a href=\"mailto:info@supermax.com\"><span class=\"glyphicon glyphicon-earphone\"></span>info@supermax.com</a>\r\n','Contáctanos','','publish','closed','closed','','contactanos','','','2018-04-10 08:50:02','2018-04-10 12:50:02','',0,'http://localhost/wordpress/?page_id=13',0,'page','',0),(15,1,'2018-03-22 12:51:43','2018-03-22 16:51:43','[caption id=\"attachment_14\" align=\"alignnone\" width=\"300\"]<img class=\"size-medium wp-image-14\" src=\"http://localhost/wordpress/wp-content/uploads/2018/03/toyota-yaris-3p-39041_1-300x200.jpg\" alt=\"Toyota Yaris Año 2018\" width=\"300\" height=\"200\" /> ToyotaYaris[/caption]','Automóviles','','inherit','closed','closed','','13-revision-v1','','','2018-03-22 12:51:43','2018-03-22 16:51:43','',13,'http://localhost/wordpress/index.php/2018/03/22/13-revision-v1/',0,'revision','',0),(18,1,'2018-03-22 15:45:41','2018-03-22 19:45:41','','Tienda','','publish','closed','closed','','tienda-online','','','2018-03-25 13:01:20','2018-03-25 17:01:20','',0,'http://localhost/wordpress/index.php/tienda/',0,'page','',0),(19,1,'2018-03-22 15:45:43','2018-03-22 19:45:43','[woocommerce_cart]','Carrito','','publish','closed','closed','','carrito','','','2018-03-22 15:45:43','2018-03-22 19:45:43','',0,'http://localhost/wordpress/index.php/carrito/',0,'page','',0),(20,1,'2018-03-22 15:45:45','2018-03-22 19:45:45','[woocommerce_checkout]','Finalizar compra','','publish','closed','closed','','finalizar-compra','','','2018-03-22 15:45:45','2018-03-22 19:45:45','',0,'http://localhost/wordpress/index.php/finalizar-compra/',0,'page','',0),(21,1,'2018-03-22 15:45:46','2018-03-22 19:45:46','[woocommerce_my_account]','Mi cuenta','','publish','closed','closed','','mi-cuenta','','','2018-03-22 15:45:46','2018-03-22 19:45:46','',0,'http://localhost/wordpress/index.php/mi-cuenta/',0,'page','',0),(59,1,'2018-03-23 08:20:51','2018-03-23 12:20:51','Alimentos, frutas, verduras, hortalizas','','','publish','closed','closed','','59','','','2018-04-13 07:13:48','2018-04-13 11:13:48','',0,'http://localhost/wordpress/?p=59',1,'nav_menu_item','',0),(60,1,'2018-03-23 08:20:52','2018-03-23 12:20:52','En nuestra sección de bebidas puedes encontrar los mejores productos de zumos y néctares, alcohol y licores , refrescos, cervezas y vinos tintos, vinos blancos, vinos rosados y sidra. Disfruta las ofertas de bebidas de gran calidad en nuestros supermercado online.','','','publish','closed','closed','','60','','','2018-04-13 07:13:49','2018-04-13 11:13:49','',16,'http://localhost/wordpress/?p=60',2,'nav_menu_item','',0),(61,1,'2018-03-23 08:20:53','2018-03-23 12:20:53','Supermercados Max es una nueva forma de comprar carne online. En esta carnicería podrás encontrar la mejor selección de carnes.  ¡ Con el compromiso Mundo Carnes de calidad !','','','publish','closed','closed','','61','','','2018-04-13 07:13:50','2018-04-13 11:13:50','',16,'http://localhost/wordpress/?p=61',5,'nav_menu_item','',0),(62,1,'2018-03-23 08:20:54','2018-03-23 12:20:54','Somos la única frutería en la que las frutas y las verduras esperan en el árbol hasta que las compras. Nuestra prioridad es el sabor de nuestros productos, elemento fundamental que se ha ido perdiendo al tratar de optimizar su duración y aspecto exterior. No somos un portal que integra distintos proveedores, compramos en origen y nos responsabilizamos del servicio de origen a destino. Llevamos directamente del campo a tu casa u oficina la mejor fruta y verdura de temporada. Cada variedad y zona de cultivo tienen su mejor momento, pero dependiendo de las condiciones climatológicas las temporadas varían. Por eso siempre confiamos en el valioso consejo de nuestros productores, que son quienes mejor conocen sus productos.','','','publish','closed','closed','','62','','','2018-04-13 07:13:50','2018-04-13 11:13:50','',16,'http://localhost/wordpress/?p=62',7,'nav_menu_item','',0),(63,1,'2018-03-23 08:20:55','2018-03-23 12:20:55','En Supermercados Max encontrarás las verduras de temporada recién cosechada en nuestra huerta ecológica. Tenemos la caja que se adecuará perfectamente a tus necesidades. Pide online ahora.','','','publish','closed','closed','','63','','','2018-04-13 07:13:51','2018-04-13 11:13:51','',16,'http://localhost/wordpress/?p=63',8,'nav_menu_item','',0),(163,1,'2018-03-23 14:50:55','2018-03-23 18:50:55','\r\n[wpgmza id=\"1\"]','Inicio','','inherit','closed','closed','','2-autosave-v1','','','2018-03-23 14:50:55','2018-03-23 18:50:55','',2,'http://localhost/wordpress/2-autosave-v1',0,'revision','',0),(164,1,'2018-03-23 10:06:16','2018-03-23 14:06:16','','Inicio','','inherit','closed','closed','','2-revision-v1','','','2018-03-23 10:06:16','2018-03-23 14:06:16','',2,'http://localhost/wordpress/2-revision-v1',0,'revision','',0),(168,1,'2018-03-23 10:12:09','2018-03-23 14:12:09','<h2>Bistec</h2>\r\n<p>Para alcanzar una alimentación balanceada es necesario consumir una cantidad adecuada de vitaminas y minerales, proteínas y azúcares, entre otros elementos necesarios para el cuerpo.</p>\r\n\r\n<p>Por lo tanto, el bistec de res, es perfecto para preparar recetas de comida mexicana, debido a que se puede cocinar fácilmente con cebollas en su propio jugo y combinarse con verduras para tener una comida completa y muchos guisados más.</p>\r\n\r\n<p>Así que ordena en línea y aprovecha las ofertas de martes de frescura que hay en Supermercados Max y retira tu pedido en cualquiera de nuestros almacenes.</p>\r\n\r\n<a href=\"https://localhost/wordpress/categoria-producto/alimentos/carnes\" class=\"black button\">Ir a la sección de Carnes</a>','Bistec','Compra por kilo la mejor carne de res para preparar bistec.','publish','open','closed','','bistec','','','2018-04-12 12:02:38','2018-04-12 16:02:38','',0,'http://localhost/wordpress/?post_type=product&#038;p=168',0,'product','',0),(169,1,'2018-03-23 10:40:10','2018-03-23 14:40:10','<h2>Hamburguesa Gourmet</h2>\r\n<p>La mejor manera de comprar carne para hamburguesa gourmet online. Ofrecemos 120 gramos de deliciosa carne de Ávila servida en bandejas de 480 gramos. Con todo el sabor de la raza Avileña Negra-Ibérica y libres de gluten.</p>\r\n\r\n<a href=\"https://localhost/wordpress/categoria-producto/alimentos/carnes\" class=\"black button\">Ir a la sección de Carnes</a>','Hamburguesa Gourmet','120 gramos de deliciosa carne para hamburguesa de Ávila servida en bandejas de 480 gramos. Con todo el sabor de la raza Avileña Negra-Ibérica y libres de gluten.','publish','open','closed','','hamburguesa-gourmet','','','2018-04-12 11:58:20','2018-04-12 15:58:20','',0,'http://localhost/wordpress/?post_type=product&#038;p=169',0,'product','',1),(170,1,'2018-03-23 10:46:16','2018-03-23 14:46:16','','max_logo','Supermercados Max','inherit','open','closed','','max_logo',