r\n\r\n<p>Los granos proceden de las fincas de Legaris y de proveedores controlados. Pasan por un despalillado suave y se trasladan a los depósitos.</p>\r\n\r\n<h2>La fermentación alcohólica y posterior maceración se prolongan alrededor de una semana.</h2>\r\n\r\nPosteriormente se realiza la fermentación maloláctica y, finalmente, Legaris Crianza envejece en barricas de roble francés la mitad y americano la otra durante doce meses. Una cuarta parte de éstas son nuevas.\r\n\r\nFinalizado este proceso, se hace el coupage definitivo y se clarifica con albúmina de huevo y se filtra suavemente.\r\n\r\nLos productos de esta bodega son vinos singulares y de marcado carácter.<p>\r\n\r\n<a href=\"https://localhost/wordpress/categoria-producto/alimentos/bebidas/bebidas-alcoholicas\" class=\"black button\">Ir a sección de Alcoholes</a>','Legaris crianza 2014-Vino Tinto 0,75L','Legaris crianza 2014-Vino Tinto 0,75L. 6 pack','publish','open','closed','','legaris-crianza','','','2018-04-13 07:06:05','2018-04-13 11:06:05','',0,'https://localhost/wordpress/?post_type=product&#038;p=631',0,'product','',0),(632,1,'2018-04-11 08:22:14','2018-04-11 12:22:14','En nuestra sección de Bebidas alcohólicas en Supermercados Max y encuenteras todo lo que buscas. disponemos de compras en línea en bebidas alcoholicas en una gran selección de Vinos, Bebidas espirituosas, Vinos espumoso y champanes, cervezas, a precios bajos. .','','','publish','closed','closed','','632','','','2018-04-13 07:13:49','2018-04-13 11:13:49','',23,'https://localhost/wordpress/?p=632',3,'nav_menu_item','',0),(633,1,'2018-04-11 08:22:16','2018-04-11 12:22:16','Los mejores precios en gaseosas en el supermercado online Supermercados Max, donde encontrarás la máxima calidad al mejor precio.','','','publish','closed','closed','','633','','','2018-04-13 07:13:49','2018-04-13 11:13:49','',23,'https://localhost/wordpress/?p=633',4,'nav_menu_item','',0),(634,1,'2018-04-11 08:28:55','2018-04-11 12:28:55','Legaris6pack','Legaris-c