INSERT INTO `wp_term_taxonomy` VALUES (1,1,'category','',0,2),(2,2,'product_type','',0,37),(3,3,'product_type','',0,0),(4,4,'product_type','',0,0),(5,5,'product_type','',0,0),(6,6,'product_visibility','',0,0),(7,7,'product_visibility','',0,0),(8,8,'product_visibility','',0,0),(9,9,'product_visibility','',0,0),(10,10,'product_visibility','',0,0),(11,11,'product_visibility','',0,0),(12,12,'product_visibility','',0,0),(13,13,'product_visibility','',0,0),(14,14,'product_visibility','',0,1),(15,15,'product_cat','',0,0),(16,16,'product_cat','<h2>Alimentos</h2>\r\n<p>La forma de comprar de los consumidores está cambiando, tanto las tiendas de ropa así como la industria alimentaria. Supermercados Max te ofrecemos la venta online de alimentos</p>',0,14),(17,17,'product_cat','<h2>Utensilios de limpieza</h2>\r\n\r\n<p>Supermercados Max ofrece los últimos utensilios de limpieza para el hogar así como aseo personal  al mejor precio.</p>',0,5),(18,18,'product_cat','<h2>Electrodomésticos</h2>\r\n<p>Supermercados Max es tu tienda onlines donde encontrar y comprar todo tipo de electrodomésticos</p>\r\n\r\n<p>Ofrecemos las mejores marcas del mercado en: frigoríficos, neveras, lavadoras así como todo tipo de pequeños electrodomésticos.</p>',0,12),(19,19,'product_cat','<h2>Muelbes</h2>\r\n<p>Supermercados Max es tu tienda onlines donde encontrar y comprar todo tipo de muebles</p>\r\n\r\n<p>Ofrecemos las mejores marcas del mercado destinadas a la decoración de oficina, hogar así como la sala/comedor.</p>',0,6),(20,20,'product_cat','<h2>Carnes</h2>\r\n<p>En nuestra sección de carnes podrás encontrar la mejor selección de carnes, así como los mejores cortes.</p>',16,2),(21,21,'product_cat','<h2>Verduras</h2>\r\n<p>En Supermercados Max encontrarás las verduras de temporada recién cosechada en nuestra huerta ecológica.</p>\r\n<p>Te ofrecemos los productos más frescos así como la mejor calida a través de tus compras online</p>',16,3),(22,22,'product_cat','<h2>Frutas</h2>\r\n\r\n<p>Somos la única frutería en la que las frutas y las verduras esperan en el árbol hasta que las compras. <strong>Nuestra prioridad es el sabor </strong>de nuestros productos, elemento fundamental que se ha ido perdiendo al tratar de optimizar su duración y aspecto exterior.</p>\r\n\r\n<p>Compramos en origen y nos responsabilizamos del servicio de origen a destino. <strong>Llevamos directamente del campo a nuestros almacenes</strong>.\r\n\r\n<p>Cada variedad y zona de cultivo tienen su mejor momento, pero dependiendo de las condiciones climatológicas las temporadas varían. Por eso siempre <strong>confiamos en el valioso consejo de nuestros productores</strong>, que son quienes mejor conocen sus productos.</p>\r\n\r\n',16,2),(23,23,'product_cat','<h2>Bebidas</h2>\r\n<p>Nuestra sección de bebidas puedes encontrar los mejores productos de zumos y néctares, así como <a href=\"https://localhost/wordpress/categoria-producto/alimentos/bebidas/bebidas-alcoholicas\"><u><strong>alcohol y licores</strong></u></a> y <a href=\"https://localhost/wordpress/categoria-producto/alimentos/bebidas/gaseosas\"><u><strong>gaseosas</strong></u></a>.  <a href=\"http://localhost/wordpress/categoria-producto/ofertas-mensuales\"><u><strong></p>\r\n\r\n<p>Disfruta las ofertas del mes</strong></u></a> en Supermercados Max.</p>',16,7),(24,24,'product_cat','<h2>Utensilios de limpieza personal</h2>\r\n\r\n<p>Supermercados Max ofrece los últimos utensilios de limpieza personal con las mejores ofertas así como el mejor precio del mercado.</p>',17,2),(25,25,'product_cat','<h2>Limpieza del hogar</h2>\r\n<p>En Supermercados Max tenemos la mayor variedad de productos destinados a limpieza del hogar así como los mejores precios</p>',17,1),(26,26,'product_cat','<h2>Limpieza de ropa</h2>\r\n<p>En Supermercados Max toda una serie de productos destinados a la limpieza de ropa</p>\r\n\r\n<p>Por que sabemos la importancia que supone mantener nuestra ropa limpia.</p>',17,2),(27,27,'nav_menu','',0,25),(31,31,'product_cat','<h2>Ofertas Diárias</h2>\r\n\r\n<p>Si estás interesado en comprar productos online Supermercados Max es tu mejor opción. Únete para aprovechar grandes <b>Ofertas diárias</b>, <a href=\"https://localhost/wordpress/categoria-producto/ofertas-semanales\">Ofertas semanales y <a href=\"https://localhost/wordpress/categoria-producto/ofertas-mensuales\">Ofertas mensuales </a></p>',0,6),(32,32,'product_cat','<h2>Ofertas Semanales</h2>\r\n\r\n<p>Si estás interesado en comprar productos online Supermercados Max es tu mejor opción. Únete para aprovechar grandes <a href=\"https://localhost/wordpress/categoria-producto/ofertas-diarias\">Ofertas diárias</a>, <b>Ofertas semanales</b> y <a href=\"https://localhost/wordpress/categoria-producto/ofertas-mensuales\">Ofertas mensuales </a></p>',0,7),(33,33,'product_cat','<h2>Ofertas Mensuales</h2>\r\n\r\n<p>Si estás interesado en comprar productos online Supermercados Max es tu mejor opción. Únete para aprovechar grandes <a href=\"https://localhost/wordpress/categoria-producto/ofertas-diarias\">Ofertas diárias</a>, <a href=\"https://localhost/wordpress/categoria-producto/ofertas-semanales\">Ofertas semanales</a> y </b>Ofertas mensuales </b></p>',0,7),(34,34,'product_cat','<h2>Carnes de Res</h2>\r\n<p>Supermercados Max le ofrece la mejor carne de res a través de Nuestro supermercado en línea. Un nuevo concepto de compras por internet desarrollado para facilitarle la vida</p>',20,2),(36,36,'ufaq-category','',0,2),(37,37,'product_cat','<h2>Televisores</h2>\r\n<p>Supermercados Max te ofrecemos todo lo que necesitas para ver mejor la televisión. Televisores, Sintonizadores TDTs, DVDs, blu-ray así como los accesorios y soportes de televisores.</p>',18,2),(38,38,'product_cat','<h2>Lavadoras Secadoras </h2>\r\n<p>En nuestra sección de Lavadoras secadoras encontrarás varios tipos de productos a precios muy bajos</p>\r\n<p>Ofrecemos las mejores marcas del mercado, Fagor, Siemens, Balay, LG así como también Teka entre otros.<p>',18,5),(39,39,'product_tag','<h2>Lavadoras</h2>\r\n<p>Supermercados Max ofrece los mejores productos así como las mejores ofertas relacionadas con lavadoras para tu hogar</p>',0,0),(40,40,'product_tag','<h2>Linea Blanca</h2>\r\n<p>Supermercados Max ofrece los mejores productos así como las mejores ofertas relacionadas con productos de linea blanca para tu hogar<p/>',0,7),(41,41,'easy-testimonial-category','',0,2),(42,42,'group','',0,0),(43,43,'ufaq-tag','',0,3),(44,44,'ufaq-category','',0,2),(45,45,'ufaq-category','',0,1),(46,46,'ufaq-tag','',0,1),(47,47,'product_cat','<h2> Gaseosas </h2>\r\n<p>Supermercados Max te ofrece los mejores precios en gaseosas así como la la máxima calidad al mejor precio.</p>',23,4),(48,48,'product_tag','<h2>Bebidas</h2>\r\n<p>Supermercados Max ofrece los mejores productos así como las mejores ofertas relacionadas con productos de bebidas para toda ocación<p/>',0,0),(50,50,'product_cat','<h2>Bebidas Alcohólicas</h2>\r\n<p>Supermercados Max ofrece en nuestra sección de Bebidas alcohólicas y todo lo que buscas.</p>\r\n\r\n<p>Disponemos de bebidas alcoholicas: Vinos, Bebidas espirituosas, Vinos espumoso y champanes así como también cervezas, a precios bajos.</p>',23,3),(53,53,'product_tag','<h2>Productos LG</h2>\r\n<p>Supermercados Max ofrece los mejores productos así como las mejores ofertas en la línea de productos LG</p>',0,4),(55,55,'product_tag','<h2>Gaseosas</h2>\r\n<p>Supermercados Max ofrece los mejores productos así como las mejores ofertas relacionadas con productos en gaseosas para toda ocación<p/>',0,4),(56,56,'product_tag','<h2>Cervezas</h2>\r\n<p>Supermercados Max ofrece los mejores productos así como las mejores ofertas relacionadas con productos en cervezas para toda ocación<p/>',0,2),(59,59,'product_cat','<h2>Refrigeradores</h2>\r\n<p>En nuestra sección de refrigeradores encontrarás varios tipos de productos a precios muy bajos</p>\r\n<p>Ofrecemos las mejores marcas del mercado, Samsung, Whirlpool, así como también LG entre otros.</p>',18,2),(60,60,'product_cat','<h2>Informática</h2>\r\n<p>En nuestra sección de informática encontrarás varios tipos de productos a precios muy bajos<p>\r\n<p>Ofrecemos las mejores marcas del mercado, HP, Lenovo, así como también Mac entre otros.</p>',18,3),(61,61,'product_tag','<h2>Productos Samsung</h2>\r\nSupermercados Max ofrece los mejores productos así como las mejores ofertas en la línea de productos Samsung',0,3),(62,62,'product_tag','<h2>Whirlpool</h2>\r\n<p>Supermercados Max ofrece los mejores productos así como las mejores ofertas en la línea de productos Whirlpool</p>',0,3),(64,64,'product_tag','',0,0),(65,65,'product_tag','',0,1),(66,66,'product_tag','',0,1),(67,67,'product_cat','<h2>Muebles para el Hogar</h2>\r\n<p>Supermercados Max es tu tienda onlines donde encontrar y comprar todo tipo de muebles para tu hogar.</p>\r\n\r\n<p>Ofrecemos las mejores marcas del mercado destinadas a la decoración de tu hogar.</p>',19,2),(68,68,'product_cat','<h2>Muebles para Oficina</h2>\r\n<p>Supermercados Max es tu tienda onlines donde encontrar y comprar todo tipo de mueblespara oficina</p>\r\n\r\n<p>Ofrecemos las mejores marcas del mercado destinadas a la decoración para tu oficina.</p>',19,2),(69,69,'product_cat','<h2>Muebles para Sala Comedor</h2>\r\n<p>Supermercados Max es tu tienda onlines donde encontrar muebles para la decoración de tu sala comedor.</p>',19,2);
